  const [doploons, setDoploons] = useState(0);
  const [small, setSmall] = useState(0);
  const [medium, setMedium] = useState(0);
  const [great, setGreat] = useState(0);
  const [powerful, setPowerful] = useState(0);
  const [showResult, setShowResult] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();

    console.log("PENIS");

    const result = dooplon_optimizator(
      doploons,
      small,
      medium,
      great,
      powerful
    );
  };

  return (
    <div className=' flex justify-center'>
      <div className='bg-white/80 rounded p-4 shadow '>
        {!showResult ? (
          <FormDoploon
            data={(doploons, small, medium, great, powerful)}
            setData={
              (setDoploons(),
              setSmall(),
              setMedium(),
              setGreat(),
              setPowerful())
            }
          />
        ) : null}
      </div>
    </div>
  );
};

export default Content;
